// WARNING. THIS PIPELINE IS VERY DESTRUCTIVE AND WILL DELETE ALL RESOURCES ON A GCP PROJECT.
// PLEASE USE WITH CAUTION.

// Which project do you want to clean up?
const PROJECT_ID = "";

// The value name of the JSON Service Account saved in the Vault
const SECRET_KEY = "";

// Dry Run
// If you set this to true, the deletion will script will not be ran.
// IF THIS IS SET TO false, THE DELETION SCRIPT WILL BE EXECUTED.
const DRY_RUN = true;

// Do not change the values below, unless you know what you are doing

// Where the commands are executed
const WORKING_DIR = "/tmp";
const SCRIPT_FILE_NAME = `dangerous_delete_${PROJECT_ID}_resource.sh`;

function run_deletion() {
    return `chmod +x ${SCRIPT_FILE_NAME} && ./${SCRIPT_FILE_NAME}`
}

async function get_key() {
  return await kaholo.vault.getValueByKey(SECRET_KEY);
}

async function import_gcp_profile() {
  const KEY = await kaholo.vault.getValueByKey(SECRET_KEY);
  const KEY_FILE = "service-kaholo.json";
  return `echo '${KEY}' > ${KEY_FILE}; gcloud auth activate-service-account --key-file ${KEY_FILE}; rm ${KEY_FILE}`;
}

function set_project() {
  return `gcloud config set project ${PROJECT_ID}`;
}

function delete_buckets() {
  return `for bucket in $(gsutil ls); do echo gsutil rm -rf $bucket | tee -a ${SCRIPT_FILE_NAME}; done;`;
}

function delete_forwarding_rules() {
  return (
    "for rules in $(gcloud compute forwarding-rules list --global --uri);" +
    `do echo gcloud compute forwarding-rules delete --quiet $rules | tee -a ${SCRIPT_FILE_NAME}; done;`
  );
}

