function save_zones_to_files() {
    return (
        "for zone in `gcloud dns managed-zones list | awk 'NR!=1 {print $1}'`;" + // get zones without a header
        "do gcloud dns record-sets list --zone=$zone | awk 'NR!=1' > $zone.zone; done;" // get zone list, without headers
    )
}

function delete_dns_records_for_all_zones() {
    return (
        // | tee -a dangerous_delete_kaholo_resource.sh; done;
        "for zone in `gcloud dns managed-zones list | awk 'NR!=1 {print $1}' `;" + // Get zone names 
        "do awk -v ZONE=$zone " + // Set ZONE as a variable in awkl
        `'{ print "gcloud dns record-sets delete " $1 " --type="$2 " --zone="ZONE }' ` + // Delete record 
        "$zone.zone " + // file being read 
        `| tee -a ${SCRIPT_FILE_NAME}; done;` // output to STDOUT and into the script file
        )
}

function delete_zones() {
    return ( 
        "for zone in `gcloud dns managed-zones list | awk 'NR!=1 {print $1}'`;" + 
        `do echo gcloud dns managed-zones delete $zone | tee -a ${SCRIPT_FILE_NAME}; done;`
    )
}
